import React from 'react';
import BioPic from '../components/BioPic'
import '../../css/client_css/BioSection.scss';

const BioSection = () => {
    return (
        <section id="bio">
            <h1>This is the Bio Section</h1>

            <div className="bio-white-bkg"><BioPic /></div>
        </section>
    );
};
export default BioSection;
